		var stack = [];
		var td = [];
		for (var i=0; i<data.length; i++){
			stack.push(data[i][1]);
			td.push([data[i][0]]);
			if (i>0) {
				stack[i] += stack[i-1];
			}
		}
		var fact = Math.PI*2/stack[stack.length - 1];
		
